import 'react-native-gesture-handler';
import React from 'react';

import { AuthProvider } from './src/context/AuthContext';
import AppNav from './src/navigation/AppNav';

function App() {
  return (
    <AuthProvider>
      <AppNav/>
    </AuthProvider>
  );
}

export default App;
